import React from "react";
import {label} from "../../utils/Constant";



const Label = () => {
  return <div className="inline-flex flex-row space-x-20 justify-center w-full h-auto bg-[#252525] p-[16px]">
      {label.map((k ,i) => {
          return(
          <div className="text-md text-white" key={i} >{k.line}</div>
           );
          })}
  </div>;
};

export default Label;
